import React from 'react';

const HomePage = () => {
    return (
        <>
            <div>
                <h1>Welcome to the home page.</h1>
            </div>
            <div className="homeVideo">
                <iframe width="560" height="315" src="https://www.youtube.com/embed/sUoYIkTZHAQ" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </div>
        </>
    )
};

export default HomePage;
